, YEAR(GETDATE()) - CAST(CASE WHEN SUBSTRING(personNID, 1, 1) = '2' THEN '19' ELSE '20' END + SUBSTRING(TBLWarasa.personNID, 2, 2) AS INT) AS Age, 
CDWarasaType.WarasaType
FROM            TBLWarasa INNER JOIN
CDSyndicate ON TBLWarasa.SyndicateId = CDSyndicate.SyndicateId INNER JOIN
CDWarasaType ON TBLWarasa.WarasaTypeId = CDWarasaType.WarasaTypeId
WHERE        (TBLWarasa.yasref = 1) AND (TBLWarasa.personNID IS NOT NULL)
), CTE2 AS
(
SELECT Syndicate, PersonId, WarasaType
, CASE 
WHEN Age < 21 THEN 'اقل من 21'
WHEN age = 21 THEN '21'
WHEN Age BETWEEN 22 AND 26 THEN 'من 26 الي 22'
WHEN Age > 26 THEN 'اكبر من 26' END AS AgeState
FROM CTE1
)
SELECT Syndicate, WarasaType, AgeState, COUNT(PersonId) AS NUM
FROM CTE2 GROUP BY Syndicate, WarasaType, AgeState";
